css:
.icon-jest {
  margin-left: 1px;
}
.icon-jest.status-ERROR {
  color: #ce4045;
}
.icon-jest.status-RUNNING {
  color: #ffff60;
}
.icon-jest.status-NORMAL {
  color: #dcdcdc;
}
.icon-jest.status-DISABLED {
  color: darkgray;
}
.icon-jest .icon:before {
  font-size: 12px;
}
.icon-jest .test-error {
  padding-left: 0.3em;
}
